import React from 'react';
import { MDBCard, MDBCardTitle, MDBCardText, MDBContainer } from "mdbreact";

const PanelPage = () => {
return (
<MDBContainer>
  <MDBCard className="card-body" style={{ width: "22rem", marginTop: "1rem" }}>
    <MDBCardTitle>About</MDBCardTitle>
    <MDBCardText>
      An application for threat analysis using live twitter feed
    </MDBCardText>
    <div className="flex-row">
      <a href="#!">MDBCard link</a>
      <a href="#!" style={{ marginLeft: "1.25rem" }}>Another link</a>
    </div>
  </MDBCard>
</MDBContainer>
);
};

export default PanelPage;
